import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const profile = () => {
  return (
    <AppLayout>
      <Head>
        <title>트위치</title>
      </Head>
      <div>Hello, profile</div>
    </AppLayout>
  );
};

export default profile;
